body.query:
{
  bundles(first: 1  where:{id: 1}) {
    ethPriceUSD
  }
  pools(first: 1000 where: {liquidity_gt: 0 volumeUSD_gt: 0}  orderBy: volumeUSD orderDirection: desc) {
      id
      token0 {id symbol name derivedETH}
      token1 {id symbol name derivedETH}
      token1Price volumeUSD
  }
}

{
  blocks(
    first: 1,
    orderBy: timestamp,
    orderDirection: desc,
    where: {
      timestamp_gt: 1627204350,
      timestamp_lt: 1627204950
    }
  ) {
    number,
    timestamp
  }
}
